import {Link} from 'react-router-dom';

export const NavBarCustomer = () => {
  return (
    <div className='navbar'>
      <div><h1>CUSTOMER</h1></div>
      <div>
        <Link to='/customer/coupons'><h3>Get my coupon</h3></Link>
        <Link to='/customer/coupons/category'><h3>Get my coupon by category</h3></Link>
        <Link to='/customer/coupons/maxPrice'><h3>Get my coupon by maxToPay</h3></Link>
        <Link to='/customer/getDetails'><h3>my Details</h3></Link>
        <Link to='/updateCoupon'><h3>Update coupon</h3></Link>
        <Link to='/customer/purchaseCoupon'><h3>purchase Coupon</h3></Link>
      </div>
    </div>
  )
}
